import React, { useEffect, useState } from 'react';
import SideNavbar from '../Components/SideNavbar';
import TableComponents from '../Components/TableComponents';

export default function Students() {
  const [THeadStudents, setTHeadStudents] = useState([]);
  const [TBodyStudents, setTBodyStudents] = useState([]);

  useEffect(() => {
    fetch('src/dataDummy/students.json') 
      .then(response => response.json())
      .then(data => setTBodyStudents(data));
  }, []);


  const handleEdit = (id) => {
    console.log(`Edit student with ID: ${id}`);
    // Logic untuk mengedit siswa
  };

  const handleDelete = (id) => {
    console.log(`Delete student with ID: ${id}`);
    // Logic untuk menghapus siswa
  };

  return (

      <div class='row'>
        <SideNavbar />

        {/* ini buat dashboard */}
        <div class='col-10 pt-5'>
          <h2 className='text-center'>Students</h2>

          <div className='dashboard-content'>
            <TableComponents
              thead={THeadStudents}
              tbody={TBodyStudents}
              handleDelete={handleDelete}
              handleEdit={handleEdit}
            />
          </div>
        </div>
      </div>

  );
}
